import React from 'react'
import "./Post.css";
import { Avatar } from '@mui/material';
function Post({name, description, message, photoUrl }) {
  return (
    <div className="post">
        <div className="post_header">
            <Avatar />
            <div className="post_info">
                <h2>Raghav Puri</h2>
                <p>Description</p>
            </div>
        </div>
        <div className="post-body">
            <p>Message goes here. OK!</p>
        </div>
    </div>
  )
}

export default Post
